    font-size: 17px;
    font-weight: bold;
  }
  .swiper-slide {
    display: flex;
    flex-direction: column;
    align-items: center;
    div {
      width: 62px;
      height: 62px;
      border-radius: 50%;
      background-color: rgb(240, 243, 243);
      display: flex;
      -webkit-box-pack: center;
      justify-content: center;
      -webkit-box-align: center;
      align-items: center;
      position: relative;
      span {
        color: white;
